`,S("img",{src:fC}),`
`,S(r.h3,{children:"Ingredients:"}),`
`,S(r.p,{children:"1 cup white flour"}),`
`,S(r.p,{children:"1 cup whole wheat flour"}),`
`,S(r.p,{children:"\xBC cup pea protein"}),`
`,S(r.p,{children:"\xBC cup organic granulated sugar"}),`
`,S(r.p,{children:"1 tbsp flaxseed meal"}),`
`,S(r.p,{children:"1tbsp baking powder"}),`
`,S(r.p,{children:"\xBD tsp salt"}),`
`,S(r.p,{children:"8 tbsp coconut oil or vegan butter, solid"}),`
`,S(r.p,{children:"\xBE - 1 cup unsweetened almond milk, or vegan milk of choice"}),`
`,S(r.p,{children:"1 tsp vanilla"}),`
`,S(r.p,{children:"1 cup craisins, or fruit of choice"}),`
`,S(r.h3,{children:"Directions"}),`
`,oe(r.ol,{children:[`
`,S(r.li,{children:"Blend all dry ingredients together in a bowl. Preheat oven to 375 degrees."}),`
`,S(r.li,{children:"Add coconut oil to dry ingredients and use your hands to work until most big pieces are broken down. If you want to make sure you got most of them, shake the bowl a little from side to side and large pieces will move to the surface. It will resemble wet sand."}),`
`,S(r.li,{children:"Add craisins, or other fruit of choice. Craisins and other dried fruit tends to stick together. I like adding them in at this stage because it can be easier to break them apart a bit and avoid overmixing or crushing delicate fruits (like blueberries) if folding in later."}),`
`,S(r.li,{children:"Mix the vanilla extract in with \xBE cup of the vegan milk of choice and add to bowl. Mix ingredients until everything is just combined, adding additional milk slowly as needed."}),`
`,S(r.li,{children:"Sprinkle a little white flour on the counter and roll out the dough into a square. It should be about 9 to 10 inches long and have a height of \xBD to \xBE inches."}),`
`,S(r.li,{children:"Use a pizza cutter or knife to cut 32 triangles out of the dough"}),`
`,S(r.li,{children:"Place onto silicone mat on top of a baking sheet."}),`
`,S(r.li,{children:"Bake for 16-18 minutes."}),`
`]}),`
`,S("img",{src:dC}),`
`,S("img",{src:pC}),`
`,S(r.h3,{children:"Tips:"}),`
`,S(r.p,{children:"When the house is really hot my coconut oil needs to be refrigerated for 15-20 minutes before use. If your oil is melty you won\u2019t get any lamination in your dough. Feel free to refrigerate your dough for 10 minutes before rolling out, or popping the scones in the freezer for a few minutes before cooking if you\u2019re worried they\u2019re getting too warm."}),`
